  render(){
  return <div>
            <h1>My name is {this.props.name}</h1>

  </div>
  }
}

Employee.propTypes={
  name: pt.string.isRequired
}

ReactDOM.render(<Employee  name="shakib"/>,document.getElementById("root"));
